import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import Home from "./Home";
import Header from "./Header";
import Product from "./Product";

function App() {
  return (
   <Router>
     <Switch>
       <Route path="/">
          <Header />
          <Home />
          <Product />
       </Route>
     </Switch>
   </Router>
  );
}

export default App;
